import { Link } from 'react-router-dom'

function Landingscreen() {
  return (
    <div className='row landing'>
        <div className="col-md-12 text-center">
            <h2 style={{color:'white', fontSize:'100px'}}>Apni Vidya</h2>
            <h1 style={{color:'#e9e9f2'}}>Find the Perfect Teacher for You</h1>
            <Link to='/home'>
            <button className='btn2 btn-primary'>Get Started</button>
            </Link>
        </div>

    </div>
  )
}

export default Landingscreen;
